import { useState } from 'react';
import './Help.css';
function Help() {
  // State to manage which content to display
  const [activeTab, setActiveTab] = useState('faq');

  return (
    <div>
      <h1>Help Center</h1>
      <div className="help-buttons">
        <button
          className={activeTab === 'faq' ? 'active' : ''}
          onClick={() => setActiveTab('faq')}
        >
          FAQ
        </button>
        <button
          className={activeTab === 'contact' ? 'active' : ''}
          onClick={() => setActiveTab('contact')}
        >
          Contact Us
        </button>
      </div>

      <div className="help-content">
        {activeTab === 'faq' && (
          <div>
            <h2>Frequently Asked Questions</h2>
            <ul>
              <li>Q: How do I create a new ticket?</li>
              <li>A: Go to the "New Ticket" page and fill out the form.</li>
              <li>Q: How can I contact support?</li>
              <li>A: Use the "Contact Us" tab to send us a message.</li>
            </ul>
          </div>
        )}
        {activeTab === 'contact' && (
          <div>
            <h2>Contact Us</h2>
            <p>
              If you need assistance, please email us at support@example.com or call us at (123) 456-7890.
            </p>
            <form>
              <div>
                <label htmlFor="name">Your Name:</label>
                <input type="text" id="name" name="name" required />
              </div>
              <div>
                <label htmlFor="message">Your Message:</label>
                <textarea id="message" name="message" required></textarea>
              </div>
              <button type="submit">Send</button>
            </form>
          </div>
        )}
      </div>
    </div>
  );
}

export default Help;
